import { Component, OnInit } from '@angular/core';
import {Flight} from '../models/flight';

const ELEMENT_DATA: Flight[] = [
  new Flight('1A', 'Israel', new Date(2013, 12, 5),
    'USA', new Date(2013, 12, 5)),
  new Flight('1A', 'Israel', new Date(2013, 12, 5),
    'USA', new Date(2013, 12, 5)),
  new Flight('1A', 'Israel', new Date(2013, 12, 5),
    'USA', new Date(2013, 12, 5)),
  new Flight('1A', 'Israel', new Date(2013, 12, 5),
    'USA', new Date(2013, 12, 5)),
  new Flight('1A', 'Israel', new Date(2013, 12, 5),
    'USA', new Date(2013, 12, 5))

];

@Component({
  selector: 'app-flights-table',
  templateUrl: './flights-table.component.html',
  styleUrls: ['./flights-table.component.css']
})
export class FlightsTableComponent implements OnInit {
  displayedColumns: string[] = ['flightNumber', 'origin', 'originDate', 'destination', 'destinationDate'];
  dataSource = ELEMENT_DATA;

  constructor() { }

  ngOnInit() {
  }

}
